import React from 'react';
import './App.css';

import NavigationBar from "./components/NavigationBar";

function App() {
  return (
    <div className="App">
        <NavigationBar></NavigationBar>
        <p>
        Welcome to our hotels!
        </p>
    </div>
  );
}

export default App;
